    false,nt"url": null,nt"notes": "This narrative report for Tewaukon National
    Wildlife Refuge summarizes refuge activities from January through April of 1957.
     The report begins with a summary of the weather and water conditions during this
    period.  Qualitative and quantitative observations are documented for fish and wildlife-
    including migratory birds, upland game birds, big game animals, fur animals, predators,
    rodents, other mammals and predacious birds.  The report includes a refuge development
    and maintenance section which discusses physical development, plantings, collections
    and receipts of seed.   A section on economic use of refuge is included in the report.
     The public relations section of the report explains: recreational uses, refuge
    visitors, refuge participation, hunting and violations. The report also reviews
    other items of interest and includes photographs.  Narrative report forms for species
    and population information in the refuge are provided.  This report describes easement
    refuges for District 5-A, which include Lake Elsie, Storm Lake and Wild Rice Lake.",nt"license_title":
